import React, { Component } from 'react'
import {
  Typography,
  Grid
} from '@material-ui/core'
import LeftRightGridLayout from './leftRightGridContainer'

class DetailGridView extends Component {
    constructor(props) {
        super(props)
        this.state = {
          isPlaidSelected: true
        }
      }


  componentWillReceiveProps(nextProps) {

  }


  render() {
    const { modelData } = this.props
    const {isPlaidSelected} = this.state;

    const plaidVarient = modelData ? modelData.filter((item) => {
        return (item.variant === 'PLAID');
    })[0] : {};

    const longRangeVariant = modelData ? modelData.filter((item) => {
        return (item.variant === 'PLAID');
    })[0] : {};

    const selectedVariant = isPlaidSelected ? plaidVarient : longRangeVariant

    console.log('selectedVariant', selectedVariant)

    return (
    <div class='modelDetailDataContainer'>
        <Typography variant="h5" > Model S Specs</Typography>
        <button class='btn'> Plaid </button>
        <button class='btn'> Long Ranger </button>
        <Grid container direction='column' spacing={2} style={{maxWidth: 400, marginTop: 30}}>
            <Grid item>
                <LeftRightGridLayout 
                leftData={{title: 'Range', 'value': selectedVariant.range}} 
                rightData={{title: 'Power Train', value: selectedVariant.powertrain}}
                />  
            </Grid>
            <Grid item>
                <LeftRightGridLayout 
                    leftData={{'title': 'Peak Power', 'value': selectedVariant.range}} 
                    rightData={{title: 'Acceleration', value: `${selectedVariant.acceleration.time}s ${selectedVariant.acceleration.speed}mph`}}
                />  
            </Grid>
            <Grid item>
                <LeftRightGridLayout 
                leftData={{'title': 'Top Speed', 'value': selectedVariant.topSpeed}} 
                rightData={{title: 'Drag Coefficient', value: selectedVariant.dragCoefficient}}
                />  
            </Grid>
            <Grid item>
                <LeftRightGridLayout leftData={{'title': 'Weight', 'value': `${selectedVariant.weight}lbs`}} rightData={{title: 'Wheels', value: `${selectedVariant.wheels[0]}" or ${selectedVariant.wheels[1]}"`}}/>  
            </Grid>
            <Grid item>
                <LeftRightGridLayout leftData={{'title': 'Range', 'value': selectedVariant.range}} rightData={{title: 'Power Train', value: selectedVariant.powertrain}}/>  
            </Grid>
            <Grid item>
                <LeftRightGridLayout leftData={{'title': 'Range', 'value': selectedVariant.range}} rightData={{title: 'Power Train', value: selectedVariant.powertrain}}/>  
            </Grid>
        </Grid>
    </div>

    )
  }
}


export default DetailGridView
